import logo from './logo.svg';
import './App.css';
import Navbar from './components/navbar';
import Footer from './footer';
import Catalog from './pages/catalog';
import Products from './components/products';


function App() {
  return (
    <div className="App">
     <h1> Dave is using react</h1>
    <Navbar></Navbar>
    <Footer></Footer>
    <Catalog></Catalog>
    <Products></Products>
    </div>
  );
}

export default App;
